script: |
  super -f text -I q8934.spq | sort > q8934.out

inputs:
  - name: q8934.spq
    data: |
      SELECT * FROM tab0 (FORMAT parquet) WHERE + col1 NOT BETWEEN - + col1 * ( + col2 ) + + CAST ( NULL AS INTEGER ) + - col0 AND - col0;
  - name: tab0

outputs:
  - name: q8934.out
    data: |
      15	81	47
      87	21	10
      97	1	99
